import React from 'react';
import './App.css';
import {useTransition} from './lib/useTransition.js'
function App() {
  const color = useTransition("#dd66ff", "#ffcc99", 1);
  const number = useTransition(0,10,3);
  return (
    <div className="App">
      <font color={color} size={Math.round(number)}>{Math.round(number)}</font>
    </div>
  );
}

export default App;
